<script type="text/javascript">
        
          (function() {
            var relegateNavigation = '';
            var handleOnMessageEvent = function(e) {
              try {
                var eventData = JSON.parse(e.data);
              } catch (err) {
                return;
              }
              if (eventData.isInitClickTag) {
                if (eventData.clickTags) {
                  for (var i = 0; i < eventData.clickTags.length; i++) {
                    var clkTag = eventData.clickTags[i];
                    window[clkTag.name] = clkTag.url;
                  }
                } else if (eventData.clickTag) {
                  window.clickTag = eventData.clickTag;
                }
                relegateNavigation = eventData.relegateNavigation;
              }
              if (eventData.hasInitSwiffyData) {
                var s = document.createElement('script');
                s.src = eventData.swiffyInfo.runtimeUrl;
                s.type = 'text/javascript';
                document.getElementById('swiffycontainer').appendChild(s);
                s.onload = function() {
                  var stage = new swiffy.Stage(document.getElementById('swiffycontainer'),
                    swiffyObject);
                  stage.setFlashVars(eventData.swiffyInfo.flashVars);
                  stage.start();
                };
              }
            };

            if (open.call) {
              window.open = function(open) {
                return function(url, name, features) {
                  if (relegateNavigation === 'parent') {
                    var message = {'clickTag': url, 'isPostClickTag': true};
                    parent.postMessage(JSON.stringify(message), '*');
                  } else {
                    var args = [url, name];
                    if (features) {
                      args.push(features);
                    }
                    open.apply(window, args);
                  }
                };
              }(window.open);
            }

            if (window.addEventListener) {
              window.addEventListener(
                  'message', handleOnMessageEvent, false);
            } else {
              window.attachEvent('onmessage', handleOnMessageEvent);
            }
          })();
        
      </script>
